import React from "react";
import { LoadingStyle } from "../../Styles/StylesComponent/LoadingStyle";
const LoadingImage = () => {
  return (
    <>
      <LoadingStyle />
      <div className="load-page">
        <div className="loader">
          <div>
            <div>
              <div>
                <div>
                  <div>
                    <div>
                      <div>
                        <div></div>
                      </div>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default LoadingImage;
